function rank(){var o=document.getElementById("form").elements;const n={i1:1,i2:2,i3:3,b1:4,b2:5,b3:6,s1:7,s2:8,s3:9,g1:10,g2:11,g3:12,p1:13,p2:14,p3:15,d1:16,d2:17,d3:18,im1:19,im2:20,im3:21,r:22,blank:0},t={1:"Iron 1",2:"Iron 2",3:"Iron 3",4:"Bronze 1",5:"Bronze 2",6:"Bronze 3",7:"Silver 1",8:"Silver 2",9:"Silver 3",10:"Gold 1",11:"Gold 2",12:"Gold 3",13:"Platinum 1",14:"Platinum 2",15:"Platinum 3",16:"Diamond 1",17:"Diamond 2",18:"Diamond 3",19:"Immortal 1",20:"Immortal 2",21:"Immortal 3",22:"Radiant"};let e=0,i=0;for(var l=0;l<o.length;l++){var a=o.item(l);console.log(a.value),e+=n[a.value],"blank"==a.value&&i--}e/=o.length+i;let p=Math.floor(e);document.getElementById("demo").innerHTML=`<h2>Sum:</h2> ${e}<br><h2>Rounded:</h2> ${p}<br><h2>Rank:</h2> ${t[p]}`}function newPlayer(){let o=0,n=document.getElementById("form");for(var t=0;t<n.elements.length;++t){n.elements[t];o++}var e=`<select id="player" name="player${o+1}">\n    <option value="blank"></option>\n    <option value="i1">Iron 1</option>\n    <option value="i2">Iron 2</option>\n    <option value="i3">Iron 3</option>\n    <option value="b1">Bronze 1</option>\n    <option value="b2">Bronze 2</option>\n    <option value="b3">Bronze 3</option>\n    <option value="s1">Silver 1</option>\n    <option value="s2">Silver 2</option>\n    <option value="s3">Silver 3</option>\n    <option value="g1">Gold 1</option>\n    <option value="g2">Gold 2</option>\n    <option value="g3">Gold 3</option>\n    <option value="p1">Platinum 1</option>\n    <option value="p2">Platinum 2</option>\n    <option value="p3">Platinum 3</option>\n    <option value="d1">Diamond 1</option>\n    <option value="d2">Diamond 2</option>\n    <option value="d3">Diamond 3</option>\n    <option value="i">Immortal</option>\n    <option value="r">Radiant</option>\n</select><br>`;$("form").append(e)}